  [],\n\t\"revision_timestamp\": \"2015-12-21T00:09:35.242897\",\n\t\"name\": \"scat-spew-data\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This project investigates the dietary consumption
  of Hawaiian monk seals using traditional dietary analysis of fecal and regurgitate
  samples.  Samples are collected opportunistically at haul out locations throughout
  the Northwestern Hawaiian Islands and Main Hawaiian Islands.  Information collected
  during sample collection includes seal identifications and location of collection.
  \  Following cleaning and drying protocols, samples are analyzed and prey hard parts
  are identified to lowest taxonomic resolution.  Identification is made to at least
  Family level, but often Genus, and occasionally Species level.\",\n\t\"license_title\":
